	add("mothball", "{\"term\":\"mothball\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|moth|ball|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a small ball of chemical pesticide and deodorant placed in or around clothing and other articles susceptible to damage from mold or moth larvae in order to protect them from this damage; mothballs have either naphthalene or paradichlorobenzene as their active ingredient\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mother", "{\"term\":\"mother\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One\u0027s mother\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A title given to a nun or a priestess\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One of the triune goddesses of the Lady in Wicca alongside the Crone and Maiden and representing a woman older than a girlish Maiden but younger than an aged Crone\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, A.J. Drew, \u0027Wicca for Couples: Making Magick Together\u0027, [http://books.google.com/books?id\u003d93ba5Pox0zUC\u0026amp;pg\u003dPA90\u0026amp;dq\u003dLady+Wicca+Maiden+Mother+Crone\u0026amp;hl\u003den\u0026amp;ei\u003dVTHcTtLPKKKliQL5mqGvCg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d16\u0026amp;ved\u003d0CIMBEOgBMA8 page 90\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"different stages of life as represented by our Lady as Maiden, \u0027\u0027Mother\u0027\u0027, and Crone, as well as our Lord as Master, Father, and Sage\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Aurora Greenbough, Cathy Jewell, \u0027The Complete Idiot\u0027s Guide to Spells and Spellcraft\u0027, [http://books.google.com/books?id\u003dnpDUCtfYxMMC\u0026amp;pg\u003dPA9\u0026amp;dq\u003dLady+Wicca+Maiden+Mother+Crone\u0026amp;hl\u003den\u0026amp;ei\u003dVTHcTtLPKKKliQL5mqGvCg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d9\u0026amp;ved\u003d0CF8Q6AEwCA page 9\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The Lady is often thought of as having three aspects: Maiden, \u0027\u0027Mother\u0027\u0027, and Crone\", \"priority\":7}]}, \"synonyms\":{}}");

