	add("motherfucker", "{\"term\":\"motherfucker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|mother|fucker|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An extremely contemptible or mean person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Up against the wall, \u0027\u0027motherfucker\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any person, often but not always with the connotation that the person is disliked or is threatening\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Check out this \u0027\u0027motherfucker\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An extremely intense experience, often but not always negative\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"War is a \u0027\u0027motherfucker\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I jammed my finger in the door yesterday. It hurt like a \u0027\u0027motherfucker\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"You mess with me, and I will come at you like a \u0027\u0027motherfucker\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A good very close friend or relative\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"How’ve you been, you crazy \u0027\u0027motherfucker\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"One who engages in incest with their mother\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"One who engages in sex with a mother, not necessarily one\u0027s own\", \"priority\":12}]}, \"synonyms\":{\"list\":[{\"text\":\"motherfunker\", \"synonymQualifier\":\"EUPHEMISTIC\"},{\"text\":\"motherhumper\", \"synonymQualifier\":\"EUPHEMISTIC\"}]}}");

	add("motherfuckerdom", "{\"term\":\"motherfuckerdom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|motherfucker|dom|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being a motherfucker\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Stephen Lemons, \u0026quot;[http://www.salon.com/2000/07/26/rosebudd/ \u0027American Pimps\u0027]\u0026quot;, \u0027Salon\u0027, 26 July 2000\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"“Let me tell you, when I stopped pimpin’, I was real negative about quitting,” Rosebudd says. “I thought I was giving up being a motherfucker. Now to a hustler, being a motherfucker is what you strive for. So when someone says ‘Rosebudd’s a motherfucker,’ that’s the highest compliment you can get because they’ve run out of adjectives. I was depressed until I realized that I was not stopping being a motherfucker, I was stopping pimpin’. I just had to become a motherfucker in another arena\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The other arena in which Rosebudd, aka John Dickson, is aiming for \u0027\u0027motherfuckerdom\u0027\u0027 is writing\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Jim Dawson, \u0027The Compleat Motherfucker: A History of the Mother of All Dirty Words\u0027, Feral House (2009), ISBN 9781932595413, [http://books.google.com/books?id\u003dnV8r64J2we0C\u0026amp;pg\u003dPA33\u0026amp;dq\u003d%22motherfuckerdom%22 page 33\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In a culture dependent upon oral traditions going back to the \u0027griots\u0027—tribal historians and genealogists—of Western Africa, the heroes of the toast were often the ultimate bad mammyjammers, the archetypes of \u0027\u0027motherfuckerdom\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Alex Pappademas, \u0026quot;[http://www.gq.com/moty/2011/jay-z-gq-men-of-the-year-issue Jay-Z King]\u0026quot;, \u0027GQ\u0027, December 2011\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Take \u0027Watch the Throne\u0027, on which two grandiose motherfuckers explore the theme of grandiose-\u0027\u0027motherfuckerdom\u0027\u0027 from vastly different perspectives, stacking dubstep on top of opera on top of Otis Redding, triumphalism on top of sorrow on top of more triumphalism, striving for a sound as vast and strange as the world they\u0027ve come to inhabit\", \"priority\":8}]}, \"synonyms\":{}}");

	add("motherfuckerhood", "{\"term\":\"motherfuckerhood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|motherfucker|hood|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being a motherfucker\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Wil Forbis, \u0027Acid Logic: A Decade of Humorous Writing on Pop Culture, Trash Cinema and Rebel Music\u0027, AuthorHouse (2008), ISBN 9781434357007, [http://books.google.com/books?id\u003dQYRlcnTvQIcC\u0026amp;pg\u003dPA66\u0026amp;dq\u003d%22motherfuckerhood%22 page 66\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In many ways, it\u0027s quite ironic that Roz Chast would be featured in an Interesting Motherfuckers column. After all, she is a mother of two, a boy and a girl. In fact, perhaps it would be more fitting to list Roz Chast\u0027s husband as an Interesting Motherfucker, at least that would be more literal, but as you can see from the definition provided at the top of the page, the phrase \u0026quot;Interesting Motherfucker\u0026quot; is really more a general description to be applied to someone who has the ability to cause others to take notice of their uniqueness and in that case, I think it\u0027s quite fair to file Roz Chast under the pedigree of Interesting \u0027\u0027Motherfuckerhood\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Zachary Lipez, \u0026quot;[http://noisey.vice.com/blog/adult-problems---a-wrap-up-of-things-that-happened-in-2012-i-can-actually-remember Adult Problems - A Wrap-Up of Things That Happened in 2012 I Can Actually Remember]\u0026quot;, \u0027Noisey\u0027, 1 January 2013\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"While I’ll never doubt our capacity for eye-rolling scorn, to expend any actually visceral hatred on Pitchfork, or any website that isn’t trafficking in landmines for baby sheep, is consigning yourself to trivial \u0027\u0027motherfuckerhood\", \"priority\":5}]}, \"synonyms\":{}}");

	add("motherfuckery", "{\"term\":\"motherfuckery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"nonsense; fooler\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027, Shannon Mayer, \u0027Veiled Threat\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Damn Will for his \u0027\u0027motherfuckery\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Peter Blauner, \u0027Intruder\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"For almost eight hours, Jake has been locked in the bowels of the system, getting a full doctorate in Advanced \u0027\u0027Motherfuckery\u0027\u0027 and High Bullshittism. First, his paperwork was lost at the precinct, which caused a two-hour wait in the holding pens\", \"priority\":5}]}, \"synonyms\":{}}");

