	add("motherwort", "{\"term\":\"motherwort\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|mother|wort|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several perennial plants, of the genus \u0027Leonurus\u0027, used in traditional medicine to help with childbirth or treat uterine disorders\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1653\u0027\u0027, \u0027The English Physician Enlarged\u0027, Folio Society 2007, p. 195\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Besides, it makes women joyful and mothers of children and settles their wombs as they should be; therefore we call it \u0027\u0027Motherwort\", \"priority\":3}]}, \"synonyms\":{}}");

	add("motif", "{\"term\":\"motif\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027moti. French|motif\u0027 (1848), with the meaning of main idea or theme\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A recurring or dominant element; a theme\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"See how the artist repeats the scroll \u0027\u0027motif\u0027\u0027 throughout the work\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A short melodic passage that is repeated in several parts of a work\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A decorative figure that is repeated in a design or pattern\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A decorative appliqué design or figure, as of lace or velvet, used in trimming\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The physical object or objects repeated at each point of a lattice. Usually atoms or molecules\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A basic element of a move in terms of why the piece moves and how it supports the fulfilment of a stipulation\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In a nucleotide or amino-acid sequence, pattern that is widespread and has, or is conjectured to have, a biological significance\", \"priority\":8}]}, \"synonyms\":{}}");

	add("motion", "{\"term\":\"motion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027motion\u0027 \u0027mocion\u0027 Middle french (ca. 1400-1600) \u0027motion\u0027 and their source, Latin \u0027motio\u0027 (movement, motion)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of progression from one place to another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A change of position with respect to time\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Dr. H. Mor\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This is the great wheel to which the clock owes its \u0027\u0027motion\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A change from one place to another\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1839\u0027\u0027, Denison Olmsted, \u0027A Compendium of Astronomy\u0027 Page 9\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Secondly, When a body is once in \u0027\u0027motion\u0027\u0027 it will continue to move forever, unless something stops it. When a ball is struck on the surface of the earth, the friction of the earth and the resistance of the air soon stop its \u0027\u0027motion\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A parliamentary action to propose something\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027motion\u0027\u0027 to amend is now open for discussion\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Yes, I agree, and thank you for your \u0027\u0027motion\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"An entertainment or show, especially a puppet show\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1644\u0027\u0027, \u0027Aeropagitica\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"when God gave him reason, he gave him freedom to choose, for reason is but choosing; he had bin else a meer artificiall \u0027Adam\u0027, such an \u0027Adam\u0027 as he is in the \u0027\u0027motions\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"from κίνησις; any change. Traditionally of four types: generation and corruption, alteration, augmentation and diminution, and change of place\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1662\u0027\u0027, w:Henry Henry More, \u0027s:An Antidote Against An Antidote Against Atheism\u0027, Book II, A Collection of Several Philosophical Writings of Dr. Henry More, p. 53\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"quot;I say, it is no uneven jot, to pass from the more faint and obscure examples of \u0027Spermatical\u0027 life to the more considerable effects of \u0027general \u0027\u0027Motion\u0027\u0027\u0027 in \u0027Minerals\u0027, \u0027Metalls\u0027, and sundry \u0027Meteors\u0027, whose easie and rude shapes may have no need of any Principle of Life, or \u0027Spermatical form\u0027 distinct from the \u0027Rest\u0027 or \u0027Motion\u0027 of the particles of the \u0027Matter\u0027.\u0026quot\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Movement of the mind, desires, or passions; mental act, or impulse to any action; internal activity\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Let a good man obey every good \u0027\u0027motion\u0027\u0027 rising in his heart, knowing that every such motion proceeds from God\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"An application made to a court or judge orally in open court. Its object is to obtain an order or rule directing some act to be done in favor of the applicant\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Change of pitch in successive sounds, whether in the same part or in groups of parts. (\u0027Conjunct motion\u0027 is that by single degrees of the scale. \u0027Contrary motion\u0027 is when parts move in opposite directions. \u0027Disjunct motion\u0027 is motion by skips. \u0027Oblique motion\u0027 is when one part is stationary while another moves. \u0027Similar\u0027 or \u0027direct motion\u0027 is when parts move in the same direction\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"The independent \u0027\u0027motions\u0027\u0027 of different parts sounding together constitute counterpoint\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"A puppet, or puppet show\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Beaumont and Fletche\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"What \u0027\u0027motion\u0027\u0027s this? the model of Nineveh\", \"priority\":25}]}, \"synonyms\":{}}");

	add("motivation", "{\"term\":\"motivation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027motivation\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Willingness of action especially in behavio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The action of motivating\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something which motivates\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An incentive or reason for doing something\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a research rating that measures how the rational and emotional elements of a commercial affect consumer intention to consider, visit, or buy something\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027motivation\u0027\u0027 scores showed that 65% of people wanted to visit our website to learn more about the offer after watching the commercial\", \"priority\":6}]}, \"synonyms\":{}}");

	add("motive", "{\"term\":\"motive\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"anglo-norman\"], \"text\":\"Middle english (1100-1500) \u0027lang\u003denm\u0027 from Anglo-norman \u0027lang\u003dfro\u0027 Middle french (ca. 1400-1600) \u0027motif\u0027 and their source, \u0027lang\u003dla|motivum\u0027 () neuter of \u0027lang\u003dla|motivus\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An idea or communication that makes one want to act, especially from spiritual sources; a divine prompting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"III.2.1.ii\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"there\u0027s something in a woman beyond all human delight; a magnetic virtue, a charming quality, an occult and powerful \u0027\u0027motive\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An incentive to act in a particular way; a reason or emotion that makes one want to do something; anything that prompts a choice of action\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1947\u0027\u0027, \u0027Under the Volcano\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Many of them at first seemed kind to him, but it turned out their \u0027\u0027motives\u0027\u0027 were not entirely altruistic\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A limb or other bodily organ that can move\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Something which causes someone to want to commit a crime; a reason for criminal behaviour\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"What would his \u0027\u0027motive\u0027\u0027 be for burning down the cottage\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"No-one could understand why she had hidden the shovel; her \u0027\u0027motives\u0027\u0027 were obscure at best\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"There was only one possible motive—namely, he wished to avoid detection as James Selby of Anaconda Ltd.\u0026amp;nbsp;[…]”\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A motif\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A motif; a theme or subject, especially one that is central to the work or often repeated\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"If you listen carefully, you can hear the flutes mimicking the cello \u0027\u0027motive\", \"priority\":14}]}, \"synonyms\":{}}");

	add("motor", "{\"term\":\"motor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin {{m|la|moto||I set in motion}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A machine or device that converts any form of energy into mechanical energy, or imparts motion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A motor car, or automobile\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was flood-tide along Fifth Avenue; \u0027\u0027motor\u0027\u0027, brougham, and victoria swept by on the glittering current; pretty women glanced out from limousine and tonneau; young men of his own type, silk-hatted, frock-coated, the crooks of their walking sticks tucked up under their left arms, passed on the Park side\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A source of power for something, an inspiration, a driving force\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any protein capable of converting chemical energy into mechanical work\", \"priority\":5}]}, \"synonyms\":{}}");

